import { SELECTED_PLAN } from "../constants";

const initialState = {
  count: 0,
  isIncrementing: false,
  isDecrementing: false,
};

const timeSlotsReducer = (state = initialState, action) => {
  switch (action.type) {
    case SELECTED_PLAN:
      return {
        ...state,
        isIncrementing: true,
      };

    default:
      return state;
  }
};
export default timeSlotsReducer;
